import React from 'react';
import Header from './Header';
import './keep.css';


const Keep = () =>{
    return(
        <>
            <Header />
            <div className="container bg-light">
                <h1 className="text-danger text-center">My Keeps</h1>
            </div>
        </>
    );
};
export default Keep;
